import React from "react";
import BootstrapTable from "react-bootstrap-table-next";
import { useState } from "react";



const Wines = () => {

    const [wines , setWines] = useState([])
  const getWines = () => {
    fetch("http://localhost:4000/getWines")
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
        setWines([json])
      });
  };

    getWines()
   
    const wineColumns = [
      {
        dataField: "id",
        text: "Product ID",
      },
      {
        dataField: "name",
        text: "Product Name",
      },
      {
        dataField: "price",
        text: "Product Price",
      },
    ];
  return (
    <div>
        Wines
      {/* <BootstrapTable keyField="id" data={wineColumns} columns={wines} /> */}
    </div>
  );
};

export default Wines;
